blem, you need an attorney you can trust. Someone who is experienced, knowledgeable and skilled. You need a lawyer who is familiar with the local court system and is ready to fight for you at trial.[/vc_column_text][distance desktop_type="30"][vc_column_text el_class="about-content"]My name is Mike Darlington. I help clients with family law and criminal defense matters at my office in Redding, California. My reputation for providing aggressive, high quality legal counsel is based on 26 years of experience.[/vc_column_text][distance desktop_type="30"][deep-title title="Extensive Litigation Work" title_heading="h6" title_color="#505050" title_font_size="16px" title_font_weight="600" title_padding_bottom="5px" subtitle_heading="h1" subtitle_text_font="font_family:Abril%20Fatface%3Aregular|font_style:400%20regular%3A400%3Anormal" shape="%5B%7B%22shape_rotate%22%3A%22none%22%7D%5D"][vc_column_text el_class="about-content"]An effective attorney must be comfortable in the courtroom. Having handled numerous criminal trials, ranging from murder to DUI, I understand the importance of preparing each case as though it will proceed to trial. Today, I use my vast litigation experience to successfully conduct criminal defense and divorce trials.[/vc_column_text][distance desktop_type="30"][vc_column_text el_class="about-content"]My experience in the courtroom is not limited to the adversarial side of the bench. For 15 years, I served as Judge Pro Tem in the Family Law Courts of San Bernardino County, California. This allowed me to understand how judges view and decide cases, giving me a well-rounded perspective of legal disputes.[/vc_column_text][distance phone_type="30"][/vc_column][vc_column width="1/2" wn_class="wn-column-5acb02566a6c1"][distance phone_type="80"][vc_single_image image="9" img_size="full" css=".vc_custom_1519554983444{margin-top: -70px !important;}"][/vc_column][/vc_row][vc_row wn_class="wn-row-5acb02566a8e8"][vc_column width="1/2" wn_class="wn-column-5acb02566a